import React from 'react';
import {BrowserRouter as Router, Route} from 'react-router-dom';
import {Switch} from 'react-router'

const App = () => {
    return (
        <Router>
            <Switch>
                <Route path="/" component={Login} exact/>
                <Route path="/main" component={MainContainer} />
            </Switch>
        </Router>
    );
}

export default App;
